import React, { useState, StyleSheet } from 'react';
import './App.css'

function App() {

  const [arrNums, setArrNums] = useState([9, 1, 3, 2, 5, 6, 9, 4, 5, 7, 8]);
  const BubbleSort = () => {
    console.log(arrNums)
  }


  BubbleSort();
  return (

    <div>
      <h3>Unsorted Data</h3>
      <ul className='numbers'>
        {arrNums.map((rows, index) => (
          <li key={index}>{rows}</li>
        ))}
      </ul>

    </div>
  );
}

export default App;
